import { useNavigate } from "react-router-dom";
import weddingImage from "../styles/images/brave2.jpeg";

const Contentt = () => {
  const navigate = useNavigate();
  return (
    <div className="content container">
      <div className="quotes-container"> {/* Mengganti urutan */}
        <p>
          Lorem ipsum dolor sit, amet consectetur adipisicing elit. Rem officiis
          nulla blanditiis totam aliquid repudiandae doloremque, facilis
          molestias, excepturi, nihil nam sunt cum aperiam non fuga accusamus
          cumque alias hic.
        </p>
      </div>
      <div className="image-container"> {/* Mengganti urutan */}
        <img className="image" src={weddingImage} alt="" />
        <h1 className="judul">Contentt</h1>
        <button className="kembali" onClick={() => navigate("/")}>
          Cover
        </button>
        <p>
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Ullam vel
          quidem, magnam ut quas atque nobis quos provident, labore illo aut
          corrupti molestiae eaque enim earum minus repellendus, dolore alias.
        </p>
      </div>
    </div>
  );
};

export default Contentt;
